"use strict";(self.webpackChunkbublik_release=self.webpackChunkbublik_release||[]).push([[5414],{8404:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"release-v0.3.7","metadata":{"permalink":"/bublik-release/release-v0.3.7","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-09-10-release-v0.3.7/index.mdx","source":"@site/blog/2024-09-10-release-v0.3.7/index.mdx","title":"Release v0.3.7","description":"We are happy to announce Bublik v0.3.7.","date":"2024-09-10T00:00:00.000Z","formattedDate":"September 10, 2024","tags":[{"label":"release","permalink":"/bublik-release/tags/release"}],"readingTime":0.43,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas"}],"frontMatter":{"title":"Release v0.3.7","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.3.7"},"nextItem":{"title":"Release v0.3.8","permalink":"/bublik-release/release-v0.3.8"}},"content":"We are happy to announce **Bublik v0.3.7**.\\n\\nIn this release we\'ve fixed small bug with markdown preview overflowing modal.\\nAlso we\'ve added more meta information for creating new bugs on log page such as hash, CMD, link to full log and link to saved location if you clicked on log line number.\\n\\n\x3c!--truncate--\x3e\\n\\n## Changelog\\n\\n### Frontend\\n\\n### \ud83d\udc1b Bug Fix\\n\\n- **run,log:** fix text overflow in new bug preview modal ([bb556e4](https://github.com/ts-factory/bublik-ui/commit/bb556e4284dad76f006a631dd64195d1eeb18b47))\\n\\n### \ud83d\ude80 New Feature\\n\\n- **log:** added new field to markdown from te-log-meta ([cb3692f](https://github.com/ts-factory/bublik-ui/commit/cb3692f3c72f148540623f9bc176c0d9dc28fa14))"},{"id":"release-v0.3.8","metadata":{"permalink":"/bublik-release/release-v0.3.8","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-09-10-release-v0.3.8/index.mdx","source":"@site/blog/2024-09-10-release-v0.3.8/index.mdx","title":"Release v0.3.8","description":"We are happy to announce Bublik v0.3.8.","date":"2024-09-10T00:00:00.000Z","formattedDate":"September 10, 2024","tags":[{"label":"release","permalink":"/bublik-release/tags/release"}],"readingTime":0.39,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas"}],"frontMatter":{"title":"Release v0.3.8","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.3.8"},"prevItem":{"title":"Release v0.3.7","permalink":"/bublik-release/release-v0.3.7"},"nextItem":{"title":"Release v0.3.6","permalink":"/bublik-release/release-v0.3.6"}},"content":"We are happy to announce **Bublik v0.3.8**.\\n\\nIn this small incremental release we\'ve fixed test parameters env breaking markdown table.\\nWe also wrapped full test path in backticks for better readability.\\n\\n\x3c!--truncate--\x3e\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\udc85 Polish\\n\\n- **log,run:** [new-bug] wrapped path to test with backticks ([0f3ca9e](https://github.com/ts-factory/bublik-ui/commit/0f3ca9efe17ec9077d6be7610b46b4f380b92369))\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **log,run:** [new-bug] added ability to display cells as code block ([94e7b59](https://github.com/ts-factory/bublik-ui/commit/94e7b59b48a6322195ccda521c23762f531baafe))\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **run,log:** [new-bug] fixed env breaking markdown table ([7f9acee](https://github.com/ts-factory/bublik-ui/commit/7f9acee3fcef6e5bbee4e7642a24b7a8c146e270))"},{"id":"release-v0.3.6","metadata":{"permalink":"/bublik-release/release-v0.3.6","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-09-09-release-v0.3.6/index.mdx","source":"@site/blog/2024-09-09-release-v0.3.6/index.mdx","title":"Release v0.3.6","description":"We are happy to announce Bublik v0.3.6.","date":"2024-09-09T00:00:00.000Z","formattedDate":"September 9, 2024","tags":[{"label":"release","permalink":"/bublik-release/tags/release"}],"readingTime":1.005,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas"}],"frontMatter":{"title":"Release v0.3.6","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.3.6"},"prevItem":{"title":"Release v0.3.8","permalink":"/bublik-release/release-v0.3.8"},"nextItem":{"title":"Release v0.3.5","permalink":"/bublik-release/release-v0.3.5"}},"content":"We are happy to announce **Bublik v0.3.6**.\\n\\n\x3c!--truncate--\x3e\\n\\nIn this release we\'ve added objective column for tests on the run page. You can access it via \\"Columns\\" menu in the toolbar.\\nWe\'ve also added \\"New Bug\\" button where you copy prefilled markdown\\n\\n## Highlights\\n\\n### Objective\\n\\nYou can toggle objective column inside column visibility menu\\n\\n![Test objective](./img/objective.png)\\n\\n### New Bug\\n\\n![Run Bug](./img/bug-run.png)\\n\\n![Log Bug Button](./img/log-bug-button.png)\\n\\n![Bug Modal](./img/new-bug-modal.png)\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \u267b Code Refactoring\\n\\n- **run:** added labels to toggle button for full/short run details ([9431427](https://github.com/ts-factory/bublik-ui/commit/9431427e972aa5e87be7beb7c6e8246e3c96948e))\\n- **run:** disabled uppercase all headers by default ([0b87b4e](https://github.com/ts-factory/bublik-ui/commit/0b87b4e351c163cf1b1cfd43db30441524e68887))\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **log:** added full path to test in new bug modal ([60bbe17](https://github.com/ts-factory/bublik-ui/commit/60bbe171e3580825b1e070e1beceaf9c984ef9b0))\\n- **log:** added new bug button for log page ([458f871](https://github.com/ts-factory/bublik-ui/commit/458f871a2e4adedc6164b06fb799e0992a298884))\\n- **run:** added new bug button to run page ([875f366](https://github.com/ts-factory/bublik-ui/commit/875f366ace180e19b33b0dded633a5f98315f88b))\\n- **run:** added objective column to run table ([7814984](https://github.com/ts-factory/bublik-ui/commit/7814984329c9557234f646cc298bbd9ced4ff58f))\\n- **ui:** added issue icon to library ([00ee4a5](https://github.com/ts-factory/bublik-ui/commit/00ee4a5bf2d25390af71d67c5276c8518251c55d))\\n- **ui:** added new bug component ([1175af4](https://github.com/ts-factory/bublik-ui/commit/1175af4a403d5af8708a70cc6921e70fe8bc6a87))\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **log:** removed redundant query param from bug link ([8bbcd58](https://github.com/ts-factory/bublik-ui/commit/8bbcd58e7bd2d8ab0daa5753a31eab3acf2ec0ab))\\n- **run:** remove redundant rowState query param ([69ae6cf](https://github.com/ts-factory/bublik-ui/commit/69ae6cfca2bbb319304ebb47c513c4f818711785))\\n\\n### Backend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **importruns:** store objectives in the database ([7dd33a6](https://github.com/ts-factory/bublik/commit/7dd33a65f47a6fc4b11d53bf99b3a44eac38507c))\\n- **run stats:** make detailed stats more informative ([c3c987b](https://github.com/ts-factory/bublik/commit/c3c987beb55fe0e1928958c1800b8e7196af20db))"},{"id":"release-v0.3.5","metadata":{"permalink":"/bublik-release/release-v0.3.5","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-08-17-release-v0.3.5/index.mdx","source":"@site/blog/2024-08-17-release-v0.3.5/index.mdx","title":"Release v0.3.5","description":"We are happy to announce Bublik v0.3.5.","date":"2024-08-17T00:00:00.000Z","formattedDate":"August 17, 2024","tags":[{"label":"release","permalink":"/bublik-release/tags/release"}],"readingTime":0.625,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas"}],"frontMatter":{"title":"Release v0.3.5","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.3.5"},"prevItem":{"title":"Release v0.3.6","permalink":"/bublik-release/release-v0.3.6"},"nextItem":{"title":"Release v0.3.4","permalink":"/bublik-release/release-v0.3.4"}},"content":"We are happy to announce **Bublik v0.3.5**.\\n\\n\x3c!--truncate--\x3e\\n\\nIn this minor release we\'ve reverted a change to show full run details by default.\\nWe now hide conclusion reason in run details in short mode.\\nWe also added common args for not processed points table to the report page.\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **report:** added common args for not processed points table ([720da5f](https://github.com/ts-factory/bublik-ui/commit/720da5fe217372c117fff70ca8629c2d2b7a8e48))\\n\\n#### \u267b Code Refactoring\\n\\n- **run,log:** omit conclusion reason from run details in short mode ([fd2817d](https://github.com/ts-factory/bublik-ui/commit/fd2817d603b01c81a24f14aa08e8515dc9c91559))\\n\\n#### \ud83d\udce6 Chores\\n\\n- **run,log:** renamed label from \\"Reason\\" to \\"Conclusion Reason\\" ([b106bb3](https://github.com/ts-factory/bublik-ui/commit/b106bb3009db56e54db40ee7ef80c35b0950c901))\\n\\n#### \ud83d\udc85 Polish\\n\\n- **run,log:** [details] fixed column alignment between term and description ([8a4780c](https://github.com/ts-factory/bublik-ui/commit/8a4780c93c675a07cc22142edf2bee814f8e310c))\\n\\n#### \ud83d\udd04 Reverts\\n\\nRevert \\"chore(log,run): changed option to show full run details by default\\" ([264849e](https://github.com/ts-factory/bublik-ui/commit/264849e9635746dea6a9bd541b73830875e75c6a))"},{"id":"release-v0.3.4","metadata":{"permalink":"/bublik-release/release-v0.3.4","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-08-16-release-v0.3.4/index.mdx","source":"@site/blog/2024-08-16-release-v0.3.4/index.mdx","title":"Release v0.3.4","description":"We are happy to announce Bublik v0.3.4.","date":"2024-08-16T00:00:00.000Z","formattedDate":"August 16, 2024","tags":[{"label":"release","permalink":"/bublik-release/tags/release"}],"readingTime":0.35,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas"}],"frontMatter":{"title":"Release v0.3.4","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.3.4"},"prevItem":{"title":"Release v0.3.5","permalink":"/bublik-release/release-v0.3.5"},"nextItem":{"title":"Release v0.3.3","permalink":"/bublik-release/release-v0.3.3"}},"content":"We are happy to announce **Bublik v0.3.4**.\\n\\n\x3c!--truncate--\x3e\\n\\nThis minor release addresses a critical bug in the report page functionality.\\nPreviously, reports were not displaying all available data, potentially leading to incomplete analysis.\\n\\nWe have resolved this issue, ensuring that all relevant information is now properly presented in the reports.\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **report:** ensure all test blocks are displayed in the report ([658540b](https://github.com/ts-factory/bublik-ui/commit/658540b28cd65d25c7cfa90d5003831905ec467e))"},{"id":"release-v0.3.3","metadata":{"permalink":"/bublik-release/release-v0.3.3","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-08-14-release-v0.3.3/index.mdx","source":"@site/blog/2024-08-14-release-v0.3.3/index.mdx","title":"Release v0.3.3","description":"We are happy to announce Bublik v0.3.3.","date":"2024-08-14T00:00:00.000Z","formattedDate":"August 14, 2024","tags":[{"label":"release","permalink":"/bublik-release/tags/release"}],"readingTime":3.24,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas"}],"frontMatter":{"title":"Release v0.3.3","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.3.3"},"prevItem":{"title":"Release v0.3.4","permalink":"/bublik-release/release-v0.3.4"},"nextItem":{"title":"Release v0.3.2","permalink":"/bublik-release/release-v0.3.2"}},"content":"We are happy to announce **Bublik v0.3.3**.\\n\\n\x3c!--truncate--\x3e\\n\\nIn this release, we\'ve introduced several new features and improvements.\\nWe\'ve added conclusion reason hover cards to the dashboard, run details, and runs page, enhancing user information.\\nA new report data zoom functionality for plots has been implemented, along with a preview log modal for the run page.\\nWe\'ve also made various UI enhancements, including improved table column width distribution in reports and the addition of an align property to the hover-card component.\\nBug fixes include resolving issues with broken links, error displays. Also the Bublik is now compatible with Ubuntu 24.04. The bugs related to importing from the source have also been solved.\\n\\n## Highlights\\n\\n### Specifying Measurements In Report Configuration\\nWe have added the ability to specify several sets of measurement parameters in the configuration to make reporting more flexible. The list of possible measurement parameters has also expanded \u2014 it is now possible to specify a tool. An example of the run report configuration can be found in [doc/wiki/report\\\\_config.json](https://github.com/ts-factory/bublik/blob/main/doc/wiki/report_config.json).\\n\\n> **Note!**\\n> Due to the above changes, **the configuration format has been changed**. See the example at the link above.\\n\\n### Not Processed Iterations In Reports\\n\\n![Report iterations](./img/iterations.png)\\n\\n### Log Preview\\n\\nWe\'ve also added log preview to the run page so you have a quick glance of the log without having to go to the full log page.\\n\\n![Log Preview](./img/log-preview.png)\\n\\n![Log Preview Modal](./img/log-preview-modal.png)\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\udd27 Continuous Integration | CI\\n\\n- added formatting check ([c84a564](https://github.com/ts-factory/bublik-ui/commit/c84a564c2fadcc5748fa168d029b178fbaf5dd1c))\\n- run formatter on code base ([4da8c4b](https://github.com/ts-factory/bublik-ui/commit/4da8c4b96944aab2d466929968818435dc9ca38f))\\n- splitted and steps into different jobs ([8de0f52](https://github.com/ts-factory/bublik-ui/commit/8de0f52a62cd757caac831ff8b87048464f610c6))\\n- swapped to prettier for formatting checks ([8170886](https://github.com/ts-factory/bublik-ui/commit/81708860b7c363f3cbca1640318f351c0bc77c15))\\n\\n#### \ud83d\udce6 Chores\\n\\n- added vscode dir to gitignore ([6fe10f3](https://github.com/ts-factory/bublik-ui/commit/6fe10f31644c3956eb17dcc8a51558110c6343f0))\\n- **deps:** upgrade nx to latest version ([bdaa929](https://github.com/ts-factory/bublik-ui/commit/bdaa929350be5dc2acdb04aa807554c28937f0d2))\\n- **log,run:** changed option to show full run details by default ([f5257f0](https://github.com/ts-factory/bublik-ui/commit/f5257f0a2d73fd791076ce5cd4c15d75aaabe666))\\n- **storybook:** remove all mocked modules ([2f4ab3d](https://github.com/ts-factory/bublik-ui/commit/2f4ab3d3fa78532488ca10224d5a7bbb9c580c09))\\n\\n#### \ud83d\udc85 Polish\\n\\n- **report:** made table columns take even width ([8981192](https://github.com/ts-factory/bublik-ui/commit/8981192c72e0b8f7ddbf17dcf6f43d4b75245ec9))\\n- **ui:** [hover-card] added align prop ([95cf988](https://github.com/ts-factory/bublik-ui/commit/95cf9881306dfc90109bd2b31aa3f1bb54082539))\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **report:** fixed broken link to report section ([31f3004](https://github.com/ts-factory/bublik-ui/commit/31f3004f07271251e3b78244aedb8411b4817798))\\n- **report:** fixed not showing error if no config id or run id present ([810ea12](https://github.com/ts-factory/bublik-ui/commit/810ea12d8c160dd671277595c56850cf8eeb2035))\\n- **storybook:** fixed wrong location for vite config ([81d7cf2](https://github.com/ts-factory/bublik-ui/commit/81d7cf2da5aa9fbe159c674c15dcff39a9d8e0cd))\\n- **ui:** fixed typescript issues in tailwind-ui ([9d22183](https://github.com/ts-factory/bublik-ui/commit/9d221838ca11c85f08e58511bd5857fab2bd1364))\\n\\n#### \u267b Code Refactoring\\n\\n- **report:** added not processed points table ([b6c8025](https://github.com/ts-factory/bublik-ui/commit/b6c80250f37195fc6da044cf5d19bc9a70181d34))\\n- **report:** upgraded to latest changes ([113c4b6](https://github.com/ts-factory/bublik-ui/commit/113c4b6a50ff2b500a3ec33d0519c4465322504e))\\n- **run:** extracted conclusion badge to shared UI lib ([fa583d8](https://github.com/ts-factory/bublik-ui/commit/fa583d8ead7d9b00fa9552e8def819b667695174))\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **dashboard:** added conclusion reason hover card to dashboard ([390685b](https://github.com/ts-factory/bublik-ui/commit/390685b7e623db855ed54dde78a0a7849c0dadf7))\\n- **report:** added report data zoom to plot ([716a7ac](https://github.com/ts-factory/bublik-ui/commit/716a7ac7487f00dc4eb2f7b25493181414a9ab4b))\\n- **run:** added conclusion reason hover card to run details ([d7a6288](https://github.com/ts-factory/bublik-ui/commit/d7a628818f7ae6e0387618b8fc4d3a279679a879))\\n- **run:** added preview log modal ([5c4056c](https://github.com/ts-factory/bublik-ui/commit/5c4056c3e8565000d4c3d1f7fd308ed8a0c51d6a))\\n- **runs:** added conclusion reason hover card to runs page ([b3215c9](https://github.com/ts-factory/bublik-ui/commit/b3215c91692a0eab9182b42c1132f1838297c37a))\\n- **ui:** added conclusion hover card component to ui lib ([1183ee4](https://github.com/ts-factory/bublik-ui/commit/1183ee4427e8c5b20a15dfb9806fea82cf1caea8))\\n\\n### Backend\\n\\n#### \ud83d\udd28 Issue Fix\\n\\n- Error in calculating detailed run statistics [#3](https://github.com/ts-factory/bublik/issues/3)\\n- Error when trying to copy a short URL [#44](https://github.com/ts-factory/bublik/issues/44)\\n- Importruns: source page parsing error [#48](https://github.com/ts-factory/bublik/issues/48)\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **requirements:** update packages versions to pick up bug fixes ([87821b4](https://github.com/ts-factory/bublik/commit/87821b4146cc5316086f37b4d678b48d37d1bcfd))\\n- **flower:** fix no workers in flower after start ([b77a9d4](https://github.com/ts-factory/bublik/commit/b77a9d464af82dca7a705d3859ce831ef58325d0))\\n- **report:** fix empty percentage base value handling ([cbd8433](https://github.com/ts-factory/bublik/commit/cbd8433c88bb0fe6541e40f7e2b6fd5d0a19a7ad))\\n- **report:** fix invalid iterations handling ([fac211d](https://github.com/ts-factory/bublik/commit/fac211d8bdfaf13deeb927e47d35355b5757683c))\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **requirements:** fix incompatibility with Ubuntu 24.04 ([070a189](https://github.com/ts-factory/bublik/commit/070a1890ed86871121b965c1a783a34b4c821153))\\n- **readme:** update info about supported OS versions ([24c5daa](https://github.com/ts-factory/bublik/commit/24c5daae76db1019510a0df6639dd5b431aa1654))\\n- **run stats:** make the conclusion clearer ([8bf342c](https://github.com/ts-factory/bublik/commit/8bf342c77610d0e85525b2961422d5e3aad8fc68))\\n- **report:** expand possibilities of measurement setting ([ef359e3](https://github.com/ts-factory/bublik/commit/ef359e30cb3dc0b6a61b1af7382aac5ce3daf235))\\n\\n#### \ud83d\udce6 Chores\\n\\n- **deploy:** make deploy more flexible ([b11ce2e](https://github.com/ts-factory/bublik/commit/b11ce2edeb013bc8c97319ffff8c451c8e3aac65))\\n- **report:** update report content structure ([0ef4d8e](https://github.com/ts-factory/bublik/commit/0ef4d8e5c058650701dc27970fe0205ac14cd30a))\\n- **report:** ensure the uniqueness of IDs throughout the report ([bc15682](https://github.com/ts-factory/bublik/commit/bc15682c36f84fcbf0bd6e2f009bb00e25754aa6))\\n\\n\\n#### \u267b Code Refactoring\\n\\n- **settings:** fix import of settings ([12b04f6](https://github.com/ts-factory/bublik/commit/12b04f6652ecd2072d2a3e416ce8df3024546327))\\n- **auth:** remove dup of getting user by access token ([f2e563e](https://github.com/ts-factory/bublik/commit/f2e563e9ff5e2ca38ff1ff76eaba6a416d318fa5))\\n- **auth:** decompose admin verification for readability ([2643347](https://github.com/ts-factory/bublik/commit/264334715a63d75520747340b96fd77b4d024ee5))\\n- **auth:** unify authentication and admin verification ([352bb06](https://github.com/ts-factory/bublik/commit/352bb0618542adf6ee214bab93c6fd5afd210014))\\n- **auth:** move auth funcs for consistency ([9bb9300](https://github.com/ts-factory/bublik/commit/9bb9300fa33bb5d5593d5ddedf6aa011ca822983))"},{"id":"release-v0.3.2","metadata":{"permalink":"/bublik-release/release-v0.3.2","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-07-04-release-v0.3.2/index.mdx","source":"@site/blog/2024-07-04-release-v0.3.2/index.mdx","title":"Release v0.3.2","description":"We are happy to announce Bublik v0.3.2.","date":"2024-07-04T00:00:00.000Z","formattedDate":"July 4, 2024","tags":[{"label":"release","permalink":"/bublik-release/tags/release"}],"readingTime":1.24,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas"}],"frontMatter":{"title":"Release v0.3.2","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.3.2"},"prevItem":{"title":"Release v0.3.3","permalink":"/bublik-release/release-v0.3.3"},"nextItem":{"title":"Release v0.3.1","permalink":"/bublik-release/release-v0.3.1"}},"content":"We are happy to announce **Bublik v0.3.2**.\\n\\n\x3c!--truncate--\x3e\\n\\nIn the latest release, we\'ve implemented several updates and improvements. We\'ve reordered buttons and links on run page. A new feature has been added to display aggregated values min/max in the logs. Bug fixes include modifying the log display to show only entries with aggr of \\"single\\" on the chart, sorting points by x-axis value on a chart in reports, making report configs and building charts in reports more flexible, making datasets for charts and tables optional in reports, and removing the \\"%\\" sign for values that are \\"-\\" or \\"na\\" in reports.\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\udce6 Chores\\n\\n- **build:** upgraded pnpm setup action to latest version ([290ad77](https://github.com/ts-factory/bublik-ui/commit/290ad7757b9f588412c24138a45fd2d38d695ae0))\\n- **run:** [details] changed order of buttons and links ([fe9b024](https://github.com/ts-factory/bublik-ui/commit/fe9b0244ccf323f1278fac908e7bbe11f0724553))\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **log:** [mi] added display for aggregated values min/max ([f476678](https://github.com/ts-factory/bublik-ui/commit/f476678ca34370d6a39e2b84f099e84eb22fb138))\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **log:** [mi] display only entries with `aggr` of \\"single\\" on chart ([e391d2a](https://github.com/ts-factory/bublik-ui/commit/e391d2aa6a78dfed7139e6d48783641eb8b6be84))\\n- **reports:** made datasets for chart/table optional ([ff7d724](https://github.com/ts-factory/bublik-ui/commit/ff7d724b37885c0f1fe00c2026c7dccf2f302027))\\n- **reports:** removed `%` for values that are \\"-\\" or \\"na\\" ([88e7416](https://github.com/ts-factory/bublik-ui/commit/88e74167b337f2518bab036c2a0882d5cb9a9318))\\n\\n### Backend\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **report:** fix incorrect measurement results order in datasets ([2636d9e](https://github.com/ts-factory/bublik/commit/2636d9ea9d54e41ebf0518867bbb83eea4f09019))\\n- **reports:** fix generation of record IDs ([bba7bcf](https://github.com/ts-factory/bublik/commit/bba7bcf351c138a3494fd7dcaac2815272cac88f))\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **report:** allow extra args in \'records\\\\_order\' in config ([0301ce1](https://github.com/ts-factory/bublik/commit/0301ce1a5d98198508d1f44869451368bfeb278c))\\n- **report:** change handling of non-numeric values of x-axis arg ([af65dac](https://github.com/ts-factory/bublik/commit/af65dac3645a9ef9ba195c127cba5187ae3393e5))\\n\\n#### \ud83d\udce6 Chores\\n\\n- **report:** make measurement units more readable ([803c9a8](https://github.com/ts-factory/bublik/commit/803c9a849756455ac2eb1ba1511e8c9b45492ee9))\\n- **cleanup:** apply linter to reports related code ([840543c](https://github.com/ts-factory/bublik/commit/840543cb6d2e9ccb75b9bcec179b11d56a4e98aa))"},{"id":"release-v0.3.1","metadata":{"permalink":"/bublik-release/release-v0.3.1","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-06-28-release-v0.3.1/index.mdx","source":"@site/blog/2024-06-28-release-v0.3.1/index.mdx","title":"Release v0.3.1","description":"We are happy to announce Bublik v0.3.1.","date":"2024-06-28T00:00:00.000Z","formattedDate":"June 28, 2024","tags":[{"label":"release","permalink":"/bublik-release/tags/release"}],"readingTime":2.16,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas"}],"frontMatter":{"title":"Release v0.3.1","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.3.1"},"prevItem":{"title":"Release v0.3.2","permalink":"/bublik-release/release-v0.3.2"},"nextItem":{"title":"Release v0.3.0","permalink":"/bublik-release/release-v0.3.0"}},"content":"We are happy to announce **Bublik v0.3.1**.\\n\\n\x3c!--truncate--\x3e\\n\\nIn the latest release of our app, we\'ve introduced several new features and improvements. Notably, we\'ve enhanced the history search form with a new `labels` field.\\nThe reports section now supports more detailed filtering by measurements, the use of partially suitable configurations, formatters to display \\"%\\" signs, handles API errors more gracefully, and added table titles. We\'ve also fixed various bugs, including default values in the history search form. Additionally, we polished the UI with background overlays in the command menu.\\n\\n## Highlights\\n\\n### Run Reports\\nNow, when building a run report, you can specify the measurements, the results of which will be contained in the report, not only by specifying the names of these measurements, but also by specifying aggregation and keys. This information must be specified in the report configuration. An example can be found in [doc/wiki/report\\\\_config.json](https://github.com/ts-factory/bublik/blob/main/doc/wiki/report_config.json).\\n\\n> **Note!**\\n> Due to the above changes, **the configuration format has been changed**. See the example at the link above.\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **history:** added labels field to history global search form ([5fc9e7b](https://github.com/ts-factory/bublik-ui/commit/5fc9e7b0418843fefa78ae7c744d1fb341b8f441))\\n- **history:** added scroll to top of the page on page change ([634934f](https://github.com/ts-factory/bublik-ui/commit/634934fce95fc155a0955056f984fe15ba67945f))\\n- **reports:** added formatters support to show \\"%\\" sign ([5e55703](https://github.com/ts-factory/bublik-ui/commit/5e55703929e931e864c5ac0806770bf8c77cef3f))\\n- **reports:** added handling for API errors for report page ([323d7ba](https://github.com/ts-factory/bublik-ui/commit/323d7bafbdcde44a074132dbc27034b5dc356b70))\\n- **reports:** added table title from Y axis label ([c5d3498](https://github.com/ts-factory/bublik-ui/commit/c5d3498f51f1d5b2184eaef231af3bf27a71bed2))\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **history:** fixed missing default values for history global search form ([f096099](https://github.com/ts-factory/bublik-ui/commit/f09609984044c74193441d909ef6334aff83b385))\\n- **history:** made field names consistent in search form ([6f569af](https://github.com/ts-factory/bublik-ui/commit/6f569afd25428e4640b2d13b37790fa131def6d6))\\n- **log:** added option to contain label inside canvas container ([5c07946](https://github.com/ts-factory/bublik-ui/commit/5c079461bb1a8c04168f19b7bab6009f96197ccc))\\n- **reports:** fixed axis label overflow inside canvas container ([79b5416](https://github.com/ts-factory/bublik-ui/commit/79b541646f429c2d14bfb7b62e3854a0180643bb))\\n- **reports:** fixed unstable key for report header list item ([a6ac058](https://github.com/ts-factory/bublik-ui/commit/a6ac058b7e85caf3f7704027a895b74c0a425289))\\n- **run:** fixed copying revision metadata without key ([eefdf45](https://github.com/ts-factory/bublik-ui/commit/eefdf45f9d8eeb2b206a1678048db72d835b5482))\\n- **runs:** [form] fixed crash when opening tags input ([90e3df6](https://github.com/ts-factory/bublik-ui/commit/90e3df62602eb510344649eb9e8f0f0bd0e101c9))\\n- **ui:** [combobox] fixed selection change callback type ([9d16f19](https://github.com/ts-factory/bublik-ui/commit/9d16f197c3078560c944739fef630646fd551773))\\n\\n#### \ud83d\udc85 Polish\\n\\n- **command:** added background overlay to command menu ([08bf23e](https://github.com/ts-factory/bublik-ui/commit/08bf23e6b43d0c1c45d7cf2921c852eabd9b9767))\\n- **run:** [reports] added gap between exit icon and report label ([de2dd4d](https://github.com/ts-factory/bublik-ui/commit/de2dd4dd698e8864bc250a7ea0ec6ca60668ecf5))\\n\\n### Backend\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **report:** fix filtering by measurements ([54431c4](https://github.com/ts-factory/bublik/commit/54431c434afe8279598b7824f38e9773f54cfe0d))\\n- **report:** support unequal measurement sequences ([97ec69a](https://github.com/ts-factory/bublik/commit/97ec69a72650153782c6e58f958ffc67ded18f64))\\n- **report:** fix calculation of percentages ([e306157](https://github.com/ts-factory/bublik/commit/e306157f60abe7f77b4fe7d3c76487a3e92b868a))\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **report:** add accounting for measurement keys and aggr ([ccd75a0](https://github.com/ts-factory/bublik/commit/ccd75a0c7cf805ba1223724659b92972f9946c87))\\n- **report:** make the name of y axis more informative ([bd6a38f](https://github.com/ts-factory/bublik/commit/bd6a38f763105b3e8035a1754d265696df7ea5ac))\\n- **report:** add formatters for table column values ([af1510f](https://github.com/ts-factory/bublik/commit/af1510f4c3289957eb13c7e334787a47d5ddf3a3))\\n- **report:** make it possible to use partially suitable config ([51f29c7](https://github.com/ts-factory/bublik/commit/51f29c7ee392d96fc0ae52b8820c2b776a30b29a))\\n\\n#### \ud83d\udc85 Polish\\n\\n- **cleanup:** replace special Unicode characters ([81109f0](https://github.com/ts-factory/bublik/commit/81109f00243e041e8eeaea6efa9bf01f9ba70434))\\n- **doc/wiki:** fix style in report config example ([db1a6e0](https://github.com/ts-factory/bublik/commit/db1a6e0c61335b8fd9b6bdb58ff3007570cbfbac))"},{"id":"release-v0.3.0","metadata":{"permalink":"/bublik-release/release-v0.3.0","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-06-06-release-v0.3.0/index.mdx","source":"@site/blog/2024-06-06-release-v0.3.0/index.mdx","title":"Release v0.3.0","description":"We are happy to announce Bublik v0.3.0.","date":"2024-06-06T00:00:00.000Z","formattedDate":"June 6, 2024","tags":[{"label":"release","permalink":"/bublik-release/tags/release"}],"readingTime":2.595,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas"}],"frontMatter":{"title":"Release v0.3.0","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.3.0"},"prevItem":{"title":"Release v0.3.1","permalink":"/bublik-release/release-v0.3.1"},"nextItem":{"title":"Release v0.2.6","permalink":"/bublik-release/release-v0.2.6"}},"content":"We are happy to announce **Bublik v0.3.0**.\\n\\n\x3c!--truncate--\x3e\\n\\nIn this relaese we\'ve added a new page featuring charts and tables to visualize and analyze run reports. Introduced a button that allows users to easily copy a short URL of the current page for sharing.\\nAdded navigation shortcuts for quick access to pages, enhancing user experience.\\n\\n## Highlights\\n\\n### Run Reports\\n\\nNow you can use Bublik for run reports building. To build a run report, an appropriate configuration is required. Information about the run report configuration format and its location can be found in [doc/wiki/reports.md](https://github.com/ts-factory/bublik/blob/main/doc/wiki/reports.md). An example of the run report configuration can be found in [doc/wiki/report_config.json](https://github.com/ts-factory/bublik/blob/main/doc/wiki/report_config.json).\\n\\nYou can find available reports on run page\\n\\n![Report Button](./img/report-1.png)\\n\\n![Report Page](./img/report-2.png)\\n\\n### Copy Short Link\\n\\nYou can shortcut button to copy short link of the current page on right top corner\\n\\n![Copy Link Button Run Page](./img/copy-1.png)\\n\\n![Copy Link Button Runs Page](./img/copy-2.png)\\n\\n### Command Menu\\n\\nWe\'ve added command menu with some shortcuts to common actions, pages\\n\\n![Command](./img/cmd-1.png)\\n\\nAlso you can copy short link to current page from command menu\\n\\n![Command Copy](./img/cmd-2.png)\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n* **reports:** added missing dependency to useMemo hook for args calculation ([b67f56b](https://github.com/ts-factory/bublik-ui/commit/b67f56bf8378c5556eaedce4553f0f40cb99e7bb))\\n* **reports:** added missing dependency to useMemo hook for chart series calculation ([38b7682](https://github.com/ts-factory/bublik-ui/commit/38b7682b700d5ad82430219adfce7858d0009b40))\\n* **reports:** added rel=\\"noreferrer\\" to external links ([8670993](https://github.com/ts-factory/bublik-ui/commit/867099344a49554f29899729860d032969e20aa7))\\n* **reports:** fixed build issues with tests ([d965e1b](https://github.com/ts-factory/bublik-ui/commit/d965e1b6692939c2b92775659cbb208df7c4d425))\\n* **reports:** fixed scroll to element id containing only numbers ([960d826](https://github.com/ts-factory/bublik-ui/commit/960d826842271495710927543bf0d46f2c0b948c))\\n* **reports:** prevent conditional calling of API query hook ([976998b](https://github.com/ts-factory/bublik-ui/commit/976998be71777a01290482fd0ffd50aca09d1ce1))\\n\\n\\n#### \ud83d\udc85 Polish\\n\\n* **reports:** added underline on hover for revision link ([9dc8ab3](https://github.com/ts-factory/bublik-ui/commit/9dc8ab3ff464eeb72dc2675ed3cf8e8a0ce73b2a))\\n* **reports:** fixed styles for dropdown menu item ([89a7921](https://github.com/ts-factory/bublik-ui/commit/89a7921867a4be3710a06cbb4ee8f420d027257d))\\n\\n\\n#### \ud83d\udce6 Chores\\n\\n* **copy-short-url:** upgraded cmdk package to latest version ([196d26b](https://github.com/ts-factory/bublik-ui/commit/196d26bddd609e802705f20a5cf5ace1b676a598))\\n* **icons:** added upload icon to icon library ([9ea35bb](https://github.com/ts-factory/bublik-ui/commit/9ea35bb226ba1c4b7b5812342bea7a771e7521d6))\\n* **reports:** extracted run-report test block ([17ac977](https://github.com/ts-factory/bublik-ui/commit/17ac97789e9b34e738761faa2d8bd93687eb2fb3))\\n* **reports:** generated library for run report ([c8fdf56](https://github.com/ts-factory/bublik-ui/commit/c8fdf56646407d7d9a0e7ef16205754bc26795ff))\\n\\n\\n#### \ud83d\ude80 New Feature\\n\\n* **copy-short-url:** added \\"copy short url\\" button to dashboard page ([5794f1b](https://github.com/ts-factory/bublik-ui/commit/5794f1bd990b99029ade8224ecdf6bdaf54f2be9))\\n* **copy-short-url:** added \\"copy short url\\" button to history page ([4f5aa78](https://github.com/ts-factory/bublik-ui/commit/4f5aa785eeb8d9268fba4757d2c80192fc2ea0c6))\\n* **copy-short-url:** added \\"copy short url\\" button to run page ([a661fed](https://github.com/ts-factory/bublik-ui/commit/a661fed0888727398fc44a304cdddd52f9baa501))\\n* **copy-short-url:** added \\"copy short url\\" to runs page ([6afdd3a](https://github.com/ts-factory/bublik-ui/commit/6afdd3a5bcf0896a00e0acab3b3be29438586f93))\\n* **copy-short-url:** added \\"copy-short-url\\" button to log page ([19b6ce1](https://github.com/ts-factory/bublik-ui/commit/19b6ce1316de6cf3c7aedcb3425602e4ab4af4bc))\\n* **copy-short-url:** added \\"copy-short-url\\" button to measurements page ([3aa5b5e](https://github.com/ts-factory/bublik-ui/commit/3aa5b5e7e89acbbb4ab90f8484da9ed1d11c521a))\\n* **copy-short-url:** added \\"copy-short-url\\" button to run page ([ba2ff97](https://github.com/ts-factory/bublik-ui/commit/ba2ff97a93a8961b02c36c9ef92d7f591a5f6105))\\n* **copy-short-url:** added button for copying short url to current page ([02af6f8](https://github.com/ts-factory/bublik-ui/commit/02af6f8ef0cacd95fef206a4cdba60f5106b08db))\\n* **copy-short-url:** added command component ([8c416c1](https://github.com/ts-factory/bublik-ui/commit/8c416c1e023585ec6c93d01c205b0489d4373caa))\\n* **copy-short-url:** added component for command to copy short url ([a5459d3](https://github.com/ts-factory/bublik-ui/commit/a5459d301a0b63059462b824633842e2043bde1a))\\n* **copy-short-url:** added endpoint for creating short url ([2fd89dd](https://github.com/ts-factory/bublik-ui/commit/2fd89ddf9f379861c29d4e15a45ceff101b1f923))\\n* **copy-short-url:** generated library for \\"copy short url button\\" ([04a0931](https://github.com/ts-factory/bublik-ui/commit/04a093141098c9f6c1cb856656aa81e699f5a3bd))\\n* **reports:** added dropdown for run configs links ([c5fb281](https://github.com/ts-factory/bublik-ui/commit/c5fb2811ffe8656714d499ef090df4ccd5e09fc6))\\n* **reports:** added initial report header ([dc1195c](https://github.com/ts-factory/bublik-ui/commit/dc1195c2471d0dbfc1c70d4fc07199d3187947eb))\\n* **reports:** added run report container component ([48591fc](https://github.com/ts-factory/bublik-ui/commit/48591fc4d874ddceb0bf614efa6c9de6e72d1ce4))\\n* **reports:** added sidebar link for run report ([bdc2f1c](https://github.com/ts-factory/bublik-ui/commit/bdc2f1c9aadd5892b65ea7c1ae614c341027bc68))\\n* **reports:** added table and chart components ([4e4d3a7](https://github.com/ts-factory/bublik-ui/commit/4e4d3a75d17c8c03f6b898265b65d4d4333fc42a))\\n* **reports:** added warnings popover ([46d983d](https://github.com/ts-factory/bublik-ui/commit/46d983dad714768c6f6676d1b4d1dba4c22c8dcd))\\n* **reports:** made revision links clickable ([41d50d8](https://github.com/ts-factory/bublik-ui/commit/41d50d8dbb44d47e1daf735d64ad0beedfe264e9))\\n\\n### Backend\\n\\n#### \ud83d\udd28 Issue Fix\\n\\n- Support Debian 12 [#17](https://github.com/ts-factory/bublik/issues/17)\\n- Add URL shortner [#26](https://github.com/ts-factory/bublik/issues/26)\\n- Add run reports support [#32](https://github.com/ts-factory/bublik/issues/32)\\n\\n#### \ud83d\udce6 Chores\\n\\n- **cleanup:** remove unnecessary logging ([32dadc6](https://github.com/ts-factory/bublik/commit/32dadc6cc862f3a7b38b8be4efa5cd9d90bb4a34))\\n- **cleanup:** remove unnecessary manage.py call ([4faeba9](https://github.com/ts-factory/bublik/commit/4faeba97b3763ed8ef1291ba2127e81be5f4a036))"},{"id":"release-v0.2.6","metadata":{"permalink":"/bublik-release/release-v0.2.6","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-05-12-release-v0.2.6/index.mdx","source":"@site/blog/2024-05-12-release-v0.2.6/index.mdx","title":"Release v0.2.6","description":"We are happy to announce Bublik v0.2.6.","date":"2024-05-12T00:00:00.000Z","formattedDate":"May 12, 2024","tags":[{"label":"release","permalink":"/bublik-release/tags/release"}],"readingTime":1.16,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas"}],"frontMatter":{"title":"Release v0.2.6","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.2.6"},"prevItem":{"title":"Release v0.3.0","permalink":"/bublik-release/release-v0.3.0"},"nextItem":{"title":"Release v0.2.5","permalink":"/bublik-release/release-v0.2.5"}},"content":"We are happy to announce **Bublik v0.2.6**.\\n\\n\x3c!--truncate--\x3e\\n\\nThis release introduces a series of small, incremental changes aimed at enhancing user experience and addressing various issues.\\nIt includes fixes for parameter-related crashes and fixes issue with parameter diff on run page.\\nAdditionally, constraints for minimum and maximum values have been added to charts.\\nNow when clicking on test in log tree log frame will be scrolled to the top to reset, We also added stacked chart mode for measurements page.\\nOverall, these updates contribute to a smoother and more refined user interface.\\n\\nBackend improvements include fixing issues with importruns.\\n\\n> **Note!**\\n> After upgrading to this version, it is necessary to clean up the databases of projects using live import:\\n> it is necessary to find and re-import runs for which TestIterationResult objects with the same `exec_seqno` exist in the database. \\n\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\udce6 Chores\\n\\n- fix run library test config ([4f3df15](https://github.com/ts-factory/bublik-ui/commit/4f3df15d2c95896a609e6c0bc4d79aefc77d335e))\\n\\n#### \ud83d\udc85 Polish\\n\\n- **log:** [chart] add constraints for min/max values ([88b5262](https://github.com/ts-factory/bublik-ui/commit/88b52621ab4324d1313dc3ee1f5d5d67e98fb98c))\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **charts:** correct tooltip message for zoom button ([aeaa1ea](https://github.com/ts-factory/bublik-ui/commit/aeaa1ea162e43c6a037dca948f9a9522b65a26e3))\\n- **run:** result parameters diff crashing on some results ([d196c74](https://github.com/ts-factory/bublik-ui/commit/d196c74f093fa8dbe8c6adbce99de907bac9b34b))\\n\\n#### \ud83d\udc77\u200d Build System\\n\\n- enable sourcemaps ([976756c](https://github.com/ts-factory/bublik-ui/commit/976756ce1bda98d6d5c2549a5c7f724c5534d268))\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **log:** scroll to top of log on test click ([e6cfda2](https://github.com/ts-factory/bublik-ui/commit/e6cfda2d8f940f52452630fd7fb270ee7de97c42))\\n- **measurements:** add stacked chart mode ([5ad0f20](https://github.com/ts-factory/bublik-ui/commit/5ad0f20e614435ac30c19ae1542e1bc2bee1c7d4))\\n\\n### Backend\\n\\n#### \ud83d\udd28 Issue Fix\\n\\n- Update during importruns error [#29](https://github.com/ts-factory/bublik/issues/29)"},{"id":"release-v0.2.5","metadata":{"permalink":"/bublik-release/release-v0.2.5","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-04-12-release-v0.2.5/index.mdx","source":"@site/blog/2024-04-12-release-v0.2.5/index.mdx","title":"Release v0.2.5","description":"We are happy to announce Bublik v0.2.5.","date":"2024-04-12T00:00:00.000Z","formattedDate":"April 12, 2024","tags":[{"label":"release","permalink":"/bublik-release/tags/release"}],"readingTime":1.475,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas"}],"frontMatter":{"title":"Release v0.2.5","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.2.5"},"prevItem":{"title":"Release v0.2.6","permalink":"/bublik-release/release-v0.2.6"},"nextItem":{"title":"Release v0.2.4","permalink":"/bublik-release/release-v0.2.4"}},"content":"We are happy to announce **Bublik v0.2.5**.\\n\\n\x3c!--truncate--\x3e\\n\\nThis update brings numerous enhancements to both the frontend and backend of Bublik.\\n\\n- On the frontend, fixes were made to address issues like page overflow in the log section\\n- Adapting search parameters to API changes in history.\\n- Fixed app crashes due to toast messages on email confirmation page.\\n- Various issues in the history section were resolved\\n- We changed default logs to experimental ones by default. You can toggle those off in user settings if you have issues with experimental or use button above \\"Legacy\\" to disable experimental logs.\\n- Backend improvements include fixing issues with detailed run statistics\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\udc85 Polish\\n\\n- **log:** fix horizontal page overflow ([803c05c](https://github.com/ts-factory/bublik-ui/commit/803c05c27c99c1e88d34ef28d0048e9e26deea3e))\\n\\n#### \u267b Code Refactoring\\n\\n- **history:** adapt search params to api changes ([91ae184](https://github.com/ts-factory/bublik-ui/commit/91ae184af0c0916cc074795f4c28b2c4379ef1a0))\\n\\n#### \ud83d\udce6 Chores\\n\\n- **log:** change default log mode to experimental ([d851f04](https://github.com/ts-factory/bublik-ui/commit/d851f0412fc47c38455c103d709b7ba7f5592f0c))\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **auth:** prevent app crash caused by toast messages ([ce1211f](https://github.com/ts-factory/bublik-ui/commit/ce1211ff30bffadfc4d246d0bb012a6714c51d2e))\\n- **history:** [checkbox] prevent double select ([ab1d2ed](https://github.com/ts-factory/bublik-ui/commit/ab1d2ed3e5818a7fab759efe5aae4780ed22b148))\\n- **history:** [form] missing default values ([ed7a34a](https://github.com/ts-factory/bublik-ui/commit/ed7a34ae00d474530a0ca1172de7a51f71437fd8))\\n- **history:** not display dates in legend ([41a2a5a](https://github.com/ts-factory/bublik-ui/commit/41a2a5a156ecd3eefe1c385060635478cf74ad8a))\\n- **history:** skipping fetching data on direct navigation ([bc721e1](https://github.com/ts-factory/bublik-ui/commit/bc721e1994a1fa34289051633616f00ba9462979))\\n- **log:** scroll to saved line ([41cf356](https://github.com/ts-factory/bublik-ui/commit/41cf3567a58cf15dd654fb6c7f4b24b92a6f2c9d))\\n\\n### Backend\\n\\n#### \ud83d\udd28 Issue Fix\\n\\n- Negative values in detailed run statistics [#20](https://github.com/ts-factory/bublik/issues/20)\\n- Strange percentages in run statistics [#22](https://github.com/ts-factory/bublik/issues/22)\\n\\n#### \ud83d\udce6 Chores\\n\\n- **history:** unify names of query params containing metas ([3c7e056](https://github.com/ts-factory/bublik/commit/3c7e0564730bc34c887a49d2eee66ac0affb84c4))\\n- **history:** support filtering by metas with type label ([bbd72e6](https://github.com/ts-factory/bublik/commit/bbd72e6c46e4101f7459f16837283c40437e1c08))\\n- **history:** structure the use of metas and their exprs ([9f400c0](https://github.com/ts-factory/bublik/commit/9f400c042bc701ef199641d82935cc921129d96b))\\n- **history:** structure the getting of query params ([94c853b](https://github.com/ts-factory/bublik/commit/94c853be40d970be17e995b6f9caa2251cbd0166))\\n- **history:** fix query param and variable names ([84f5342](https://github.com/ts-factory/bublik/commit/84f5342c51eabe8ad3e4831410e3336c67ec5044))\\n- **history:** add comments and division into blocks ([b00caac](https://github.com/ts-factory/bublik/commit/b00caac3015021ddadd7b7da7e46c536b21a59b6))\\n- **history:** make the order of getting data more logical ([09f06e7](https://github.com/ts-factory/bublik/commit/09f06e7f2ab15f75d2bbd20d56ddb991e1f98cd5))"},{"id":"release-v0.2.4","metadata":{"permalink":"/bublik-release/release-v0.2.4","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-03-12-release-v0.2.4/index.mdx","source":"@site/blog/2024-03-12-release-v0.2.4/index.mdx","title":"Release v0.2.4","description":"We are happy to announce Bublik v0.2.4.","date":"2024-03-12T00:00:00.000Z","formattedDate":"March 12, 2024","tags":[{"label":"release","permalink":"/bublik-release/tags/release"}],"readingTime":0.28,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas"}],"frontMatter":{"title":"Release v0.2.4","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.2.4"},"prevItem":{"title":"Release v0.2.5","permalink":"/bublik-release/release-v0.2.5"},"nextItem":{"title":"Release v0.2.3","permalink":"/bublik-release/release-v0.2.3"}},"content":"We are happy to announce **Bublik v0.2.4**.\\n\\n\x3c!--truncate--\x3e\\n\\nThe release, a small incremental update, prioritizes performance improvements by optimizing log tree representation.\\nThis involves refining the structure of the tree to enhance efficiency,\\nmaking operations within the backend system more streamlined and faster.\\n\\n## Changelog\\n\\n### Backend\\n\\n#### \u26a1 Performance\\n\\n- **tree:** optimize tree representation ([0cd05c6](https://github.com/ts-factory/bublik/commit/0cd05c64bb275ec949d0aeddd0f89a46a7735be4))"},{"id":"release-v0.2.3","metadata":{"permalink":"/bublik-release/release-v0.2.3","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-02-23-release-v0.2.3/index.mdx","source":"@site/blog/2024-02-23-release-v0.2.3/index.mdx","title":"Release v0.2.3","description":"We are happy to announce Bublik v0.2.3.","date":"2024-02-23T00:00:00.000Z","formattedDate":"February 23, 2024","tags":[{"label":"release","permalink":"/bublik-release/tags/release"}],"readingTime":0.915,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas"}],"frontMatter":{"title":"Release v0.2.3","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.2.3"},"prevItem":{"title":"Release v0.2.4","permalink":"/bublik-release/release-v0.2.4"},"nextItem":{"title":"Release v0.2.2","permalink":"/bublik-release/release-v0.2.2"}},"content":"We are happy to announce **Bublik v0.2.3**.\\n\\n\x3c!--truncate--\x3e\\n\\n# Highlights\\n\\n### User preferences\\n\\nNow you can adjust some settings and default in user settings if you have an account\\n\\n![user prefs](./img/user-preferences.png)\\n\\n### Run results diff highlight\\n\\nNow you can click on result row to highlight parameter difference relative to click row\\n\\n![run highlight](./img/run-highlight.png)\\n\\n### Performance regression\\n\\nWe\'ve added simple form to catch regressions in speed\\nList of URLs can be configured via config options\\n\\n![perf test](./img/perf-test.png)\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\udc77\u200d Build System\\n\\n* **docker:** add docker for easily bootstrapping dev env ([f0da04d](https://github.com/ts-factory/bublik-ui/commit/f0da04db315506a64d04e8932f265fc0be6d250f))\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n* **providers:** [tooltip] disable hoverable content ([dc6baf5](https://github.com/ts-factory/bublik-ui/commit/dc6baf5ee560c7ed9881802efde702607def69b4))\\n* **ui:** [checkbox] not updating on label click ([3475b01](https://github.com/ts-factory/bublik-ui/commit/3475b01081281b6766da0cd691df52d2c5aa1efc))\\n\\n#### \ud83d\ude80 New Feature\\n\\n* **log:** make log page respect user preferences ([ef5ebe3](https://github.com/ts-factory/bublik-ui/commit/ef5ebe34c5c9954252dc0d3cebfe09af2a273c45))\\n* **performance:** add view for bublik performance self-testing ([2a3619b](https://github.com/ts-factory/bublik-ui/commit/2a3619b4dc8f3258459d84e3816fb5c5bd3060b9))\\n* **run:** add ability to highlight param difference ([b75d295](https://github.com/ts-factory/bublik-ui/commit/b75d2956820c99673e4516d7ffa9522cdcb7a205))\\n* **ui:** add radio group component ([aa27baa](https://github.com/ts-factory/bublik-ui/commit/aa27baa741f637dcdb39235b5233f1506c0653f8))\\n* **user:** [preferences] add user preferences form ([2ce58ce](https://github.com/ts-factory/bublik-ui/commit/2ce58cebce2e08bf884f2669e0fbb3aa57fa5ba3))\\n\\n### Backend\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **history:** fix filtering by expressions ([e808026](https://github.com/ts-factory/bublik/commit/e808026a549b193e0caa66afcb64ffe370d4afd2))\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **performance:** add performance check ([d27a9fe](https://github.com/ts-factory/bublik/commit/d27a9fedd4875165ac3bea9dec3b0f15744b12d3))"},{"id":"release-v0.2.2","metadata":{"permalink":"/bublik-release/release-v0.2.2","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2024-02-01-release-v0.2.2/index.mdx","source":"@site/blog/2024-02-01-release-v0.2.2/index.mdx","title":"Release v0.2.2","description":"We are happy to announce Bublik v0.2.2.","date":"2024-02-01T00:00:00.000Z","formattedDate":"February 1, 2024","tags":[{"label":"release","permalink":"/bublik-release/tags/release"}],"readingTime":1.88,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas"}],"frontMatter":{"title":"Release v0.2.2","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.2.2"},"prevItem":{"title":"Release v0.2.3","permalink":"/bublik-release/release-v0.2.3"},"nextItem":{"title":"Release v0.2.1","permalink":"/bublik-release/release-v0.2.1"}},"content":"We are happy to announce **Bublik v0.2.2**.\\n\\n\x3c!--truncate--\x3e\\n\\n# Highlights\\n\\n## Improved history speed\\n\\nWe have improved the speed of the history page by optimizing the backend SQL queries.\\n\\n## Improved import logs\\n\\nNow you can see logs of the import process in real-time while the import is running.\\n\\n![Import logs](./img/import-log.png)\\n\\n:::info\\nLogs updated every 5 seconds.\\n:::\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\udd27 Continuous Integration | CI\\n\\n- **release,ci:** fix formatting and pass env through global config ([03b1dab](https://github.com/ts-factory/bublik-ui/commit/03b1dab85d780bc0fd71b2277fd451c6a8a780bc))\\n\\n#### \ud83d\udc85 Polish\\n\\n- **import:** fix import table overflowing horizontally ([b66d49c](https://github.com/ts-factory/bublik-ui/commit/b66d49ce41918861f9425452610e9a213e8eca17))\\n- **ui:** [toaster] add colors for different states ([2955b94](https://github.com/ts-factory/bublik-ui/commit/2955b94a3611e6129b20fe19da71326fb25d9b6e))\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **import:** add live import logs via polling for changes ([75ab1b1](https://github.com/ts-factory/bublik-ui/commit/75ab1b1a51e548b86c4e4235b61de54f48516bd0))\\n- **run:** add tip for ctrl+click on run page ([5ca2912](https://github.com/ts-factory/bublik-ui/commit/5ca29124d42b79c8a76c662ee0dcad1a7fc2329c))\\n\\n#### \ud83d\udce6 Chores\\n\\n- **auth:** allow access to dev section for unauthenticated users ([b7f83f2](https://github.com/ts-factory/bublik-ui/commit/b7f83f26546526ce9d458c1860af967de82e35de))\\n- **nx:** upgrade nx and it\'s packages to latest versions ([ad45ca6](https://github.com/ts-factory/bublik-ui/commit/ad45ca634506812fdbcd8999f39852cd64f3f484))\\n- **storybook:** cleanup unused imports/types ([e1039f2](https://github.com/ts-factory/bublik-ui/commit/e1039f25d7dbaa75f2070909cd7f7134ca8e33e0))\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **build:** adjust release config to allow releases from branches other than `main` ([22a6f6b](https://github.com/ts-factory/bublik-ui/commit/22a6f6be3555e509f16ed7c1b0999dd2d98501d5))\\n- **import:** [import-form] allow empty URL ([33347a3](https://github.com/ts-factory/bublik-ui/commit/33347a30152a6faafb6b5fe9ee6d16a0485faef1))\\n- **log:** fix json log overflow scrolling not working ([537677c](https://github.com/ts-factory/bublik-ui/commit/537677cf6729cacb226645fc9fb905430bf2a535))\\n\\n### Backend\\n\\n#### \ud83d\udd28 Issue Fix\\n\\n- Error on measurement results processing during live import [#2](https://github.com/ts-factory/bublik/issues/2)\\n- Error in calculating detailed run statistics [#3](https://github.com/ts-factory/bublik/issues/3)\\n- Live import: incorrect call to the do\\\\_nothing() function [#5](https://github.com/ts-factory/bublik/issues/5)\\n- \\"IndexError: list index out of range\\" on meta categorization request [#8](https://github.com/ts-factory/bublik/issues/8)\\n- Unclear logs message: no priority was specified, defaulting to 4 [#9](https://github.com/ts-factory/bublik/issues/9)\\n- Logs ticket service should not be restarted if Kerberos keytab is not configured [#12](https://github.com/ts-factory/bublik/issues/12)\\n- Revive and improve initial deploy script to simplify first time setup [#13](https://github.com/ts-factory/bublik/issues/13)\\n\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **importruns:** fix sending failed mails ([bdc1ec0](https://github.com/ts-factory/bublik/commit/bdc1ec0c38e9f8fe4e852520e0e9614e7c48aa70))\\n- **importruns:** fix import log link ([0f177f4](https://github.com/ts-factory/bublik/commit/0f177f49f5d2967f51d88259dc584081c18ca6cc))\\n\\n#### \u26a1 Performance\\n\\n- **history:** speed up history by optimizing DB queries ([1a767ec](https://github.com/ts-factory/bublik/commit/1a767ecb51d00774506979d2b5f01a01c0ca8601))\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **deploy:** add services stop option ([09082fd](https://github.com/ts-factory/bublik/commit/09082fd5abed4eee556736b4102ad85f28b7b02b))\\n- **deploy:** make services restart by default ([87f6501](https://github.com/ts-factory/bublik/commit/87f6501557fd6804b5c0fe42b0e5cf53db0f7e84))\\n- **deploy:** add the option to quietly restart services ([409066e](https://github.com/ts-factory/bublik/commit/409066e9d1f3fe0c8e646d3c43ea8cbac569317a))\\n\\n#### \ud83d\udcbe DB Changes\\n\\n- **models:** speed up history by speed up meta filtering ([4f94f7c](https://github.com/ts-factory/bublik/commit/4f94f7c84654b833d5497611357a177342bfc0d6))\\n\\n#### \ud83d\udce6 Chores\\n\\n- **auth:** unify response messages ([a8aeda6](https://github.com/ts-factory/bublik/commit/a8aeda68ac45df5b6c2dcaf61618fa0a3374bc2c))\\n- **cleanup:** unify quotes in error messages ([6d832cb](https://github.com/ts-factory/bublik/commit/6d832cbeb711bc9095b7f0340ade64279e2b3024))\\n- **deploy:** remove an extra duplicate function ([a681cab](https://github.com/ts-factory/bublik/commit/a681cab70bf9c3dd670039e8a41dbd93914d43ee))"},{"id":"release-v0.2.1","metadata":{"permalink":"/bublik-release/release-v0.2.1","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2023-12-29-release-v0.1.11/index.mdx","source":"@site/blog/2023-12-29-release-v0.1.11/index.mdx","title":"Release v0.2.1","description":"We are happy to announce Bublik v0.2.1.","date":"2023-12-29T00:00:00.000Z","formattedDate":"December 29, 2023","tags":[{"label":"release","permalink":"/bublik-release/tags/release"}],"readingTime":3.745,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/okt-limonikas","imageURL":"https://github.com/okt-limonikas.png","key":"okt-limonikas"}],"frontMatter":{"title":"Release v0.2.1","authors":["okt-limonikas"],"tags":["release"],"slug":"release-v0.2.1"},"prevItem":{"title":"Release v0.2.2","permalink":"/bublik-release/release-v0.2.2"},"nextItem":{"title":"Release v0.1.10","permalink":"/bublik-release/release-v0.1.10"}},"content":"We are happy to announce **Bublik v0.2.1**.\\n\\n\x3c!--truncate--\x3e\\n\\n# Highlights\\n\\n### Authentication Module\\nAt the moment, the Bublik authentication module exists separately from the rest of the Bublik functionality. If you want to test its work, you can contact the developer of the Bublik.\\n\\n:::info\\nThe authentication module in the Bublik has nothing to do with authentication on the server. Thus, you cannot access the system using your server credentials. To access the system, you need to be registered directly in the Bublik authentication module.\\n:::\\n\\n#### User\\n\\n\\n\\n![Login form](./img/auth.png)\\n\\nRegistration\\nUsers who are not project administrators are registered in the system by the administrator. After user registration, a verification link will be sent to the email address specified during registration. The user will be able to log in only after confirming the email address by clicking on the link from the incoming email.\\n\\nProfile page\\n\\n![Profile page](./img/profile.png)\\n\\nFeatures\\n- update your first and last name;\\n- change the password from your profile;\\n- reset the password via email.\\n\\n#### Administrator\\n\\nAdmin management table\\n\\n![Admin](./img/admin-users.png)\\n\\nRegistration\\nIf you are the administrator of the project and want to be registered in the system, please contact the administrator of the Bublik.\\n\\nFeatures\\n- update your first and last name;\\n- change the password from your profile;\\n- reset the password via email;\\n- view the list of users;\\n- create a user;\\n- change the user\'s first name, last name and password;\\n- deactivate the user.\\n\\n\\n:::info\\nOnly one user can be registered to one email address.\\nIn this release we\'ve added authentication with access to profile and user management for admins\\n:::\\n\\n### Runs\\n\\nWe\'ve added new mode for runs page which contains various charts to get an easy overview of filtered runs\\n\\n:::info\\nSome charts are clickable\\n:::\\n\\n![Runs charts](./img/runs-charts.png)\\n\\n### History expressions\\n\\nAdded expression support for multiple history fields\\n\\n![History expressions](./img/history-fields.png)\\n\\n### Import logs\\n\\nIntegrated import logs\\n\\n![Import logs](./img/import-logs.png)\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **dashboard:** add popover button with icon and comment if run is marked as compromised\\n- **dashboard:** add TV mode for dashboard for fullscreen viewing\\n- **auth:** add authentication\\n- **auth:** add user profile page\\n- **import:** integrate import logs inside bublik\\n- **history:** sync client filter state with search params\\n\\n#### \ud83d\udc85 Polish\\n\\n- **ui** improve scrollbar behaviour when main container is overflowing\\n- **ui** convert all colors to HSL with support of opacity\\n- **dashboard** replace dashboard mode icons with updated ones\\n- **dashboard** make dashboard errors to display properly\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **dashboard** failing recursively on dashboard fetch error\\n- **dashboard** not fetching dashboard when run is marked as compromised\\n- **history** changing date in form and closing not picking correct date\\n- **history** changing mode when no page exists returns 404\\n\\n#### \u267b Code Refactoring\\n\\n- **dashboard** refactor dashboard table as well as search params\\n\\n#### \ud83d\udc77\u200d Build System\\n\\n- **ci** update ci/cd actions to latest versions\\n\\n### Backend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **import log** create API to return JSON import log\\n- **auth** add the ability to register users ([fb0a439](https://github.com/ts-factory/bublik/commit/fb0a4390ae22e4b6cdbcd3d29f89ea467a542195))\\n- **auth** add the ability to log in ([6428320](https://github.com/ts-factory/bublik/commit/6428320b4517603bd4f49e151658748a5d9a1f28))\\n- **auth** add the ability to get user info ([e438cc5](https://github.com/ts-factory/bublik/commit/e438cc5950966a8265a484a93c890e056a9ec643))\\n- **auth** add the ability to refresh access token ([8911464](https://github.com/ts-factory/bublik/commit/891146419ec10df9777147ec581b05f502fbc0d0))\\n- **auth** add the ability to log out ([ffb2c80](https://github.com/ts-factory/bublik/commit/ffb2c80079020347fc649ea9df633fa78cb82730))\\n- **auth** add the ability to reset password by email ([70f4c50](https://github.com/ts-factory/bublik/commit/70f4c50baf99ec8cc1bf226185216cfb064ea6c3))\\n- **auth** add the ability to reset password from the profile ([9d43203](https://github.com/ts-factory/bublik/commit/9d43203d9163536d56331ae982edb807725f0aff))\\n- **auth** add admin functions and admin verification ([e6a4e50](https://github.com/ts-factory/bublik/commit/e6a4e50d2ca8371d0225b5473fe54d60c6048cda))\\n- **auth** add the ability to update user info yourself ([30a0029](https://github.com/ts-factory/bublik/commit/30a0029ec585e57e159d77ae9bb2750d84271e9c))\\n- **history** separate expressions by meta types\\n- **history** add verdicts expression\\n- **history** add test arguments expression\\n\\n#### \ud83d\udcbe DB changes\\n\\n- **auth** add a custom User model\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **import** fix import from bublik.xml\\n- **urls** fix dashboard redirect to v2\\n- **log** check the ID and the page query parameter value\\n- **run stats** take into account DU value when calculating run conclusion\\n- **run stats** fix abnormal counter\\n- **history** change error reporting in filtering by expressions\\n- **history** fix filtering by expressions\\n- **history** fix a list of IDs of filtered runs generation\\n\\n#### \u270f\ufe0f Other\\n\\n- **API v1 removal** move redirection to flower to other redirects\\n- **API v1 removal** move meta categorization web interface to API v2\\n- **API v1 removal** move import log web interface to API v2\\n- **API v1 removal** extend the functionality of the import via API v2"},{"id":"release-v0.1.10","metadata":{"permalink":"/bublik-release/release-v0.1.10","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2023-10-22-release-v0.1.10/index.mdx","source":"@site/blog/2023-10-22-release-v0.1.10/index.mdx","title":"Release v0.1.10","description":"We are happy to announce Bublik v0.1.10.","date":"2023-10-22T00:00:00.000Z","formattedDate":"October 22, 2023","tags":[{"label":"release","permalink":"/bublik-release/tags/release"}],"readingTime":2.185,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/ol-limonikas","imageURL":"https://github.com/ol-limonikas.png","key":"ol-limonikas"}],"frontMatter":{"title":"Release v0.1.10","authors":["ol-limonikas"],"tags":["release"],"slug":"release-v0.1.10"},"prevItem":{"title":"Release v0.2.1","permalink":"/bublik-release/release-v0.2.1"},"nextItem":{"title":"Release v0.1.8","permalink":"/bublik-release/release-v0.1.8"}},"content":"We are happy to announce **Bublik v0.1.10**.\\nIn this release we focused mainly on improving existing pages and refining user experience\\n\\n\x3c!--truncate--\x3e\\n\\n# Highlights\\n\\n### Floating log table filter toolbar\\n\\nWe\'ve added toolbar floating toolbar at the top of log table to allow access to filters when scrolled after\\n\\n![Button to open toolbar](./img/toolbar-1.png)\\n\\n![Opened toolbar](./img/toolbar-2.png)\\n\\n### Log time\\n\\nYou can now see time delta relative to selected row if you enable \\"time delta mode\\"\\n\\n![Log delta](./img/delta-1.png)\\n\\n### Improved sidebar scrolling\\n\\nWe improved sidebar scrolling\\n\\n:::info\\nIn collapsed state sidebar will expand links for active page only\\n:::\\n\\n:::tip\\nYou can press `S` on keyboard to open or collapse sidebar without clicking\\n:::\\n\\n![Sidebar](./img/sidebar-1.png)\\n\\n### Reworked import form\\n\\n:::tip\\nYou can paste multiple URLs separated by space or newline character to prefill the form faster\\n:::\\n\\n![Import form](./img/import-form-1.png)\\n\\n## Changelog\\n\\n### Frontend\\n\\n## [0.26.0] (2023-10-20)\\n\\n### \ud83d\ude80 New Feature\\n\\n- **router:** start loading whole app with spinner\\n- **ui:** [form-alert]: add form alert component\\n- **ui:** [sidebar] improve scrollbar behaviour for sidebar\\n- **log:** add floating toolbar\\n\\n### \ud83d\udc1b Bug Fix\\n\\n- **import:** base query not adding prefix in queryFn\\n- **log:** animation not working for highlighting row\\n- **log:** properly handle errors from JSON API\\n- **diff:** improve error message when no ids selected\\n- **types:** remove runs config type from router\\n- **auth:** [login-form] display error when invalid credentials provided\\n- **run:** [page] not prefetching tree in log page\\n\\n### \ud83d\udce6 Chores\\n\\n- **changelog:** [confetti] remove changelog modal\\n- **import:** add 4 default rows for import\\n- **sidebar:** remove tests link from sidebar\\n- **log:** change title of log level\\n- **nx:** migrate to latest nx\\n- **ui:** fix some react keys logic\\n- cleanup old todos\\n\\n### \ud83d\udc85 Polish\\n\\n- **dashboard:** fix border-radius not being consistent in header\\n- **log:** fix floating button overlaying toolbar popovers\\n- **run:** add styles for sorted columns\\n- **log:** add partially expanded row color\\n- **log:** emphasize floating toolbar button styles\\n- **log:** fix styling for wrapped file block\\n- **log:** improve line breaking for pre-formatted elements\\n- **log:** improve word breaking\\n- **log:** move log bgs to css variables\\n- **ui:** [button] missing border in disabled state\\n- **vars:** change all colors to hsl and allow opacity change\\n- **vars:** fixs overlay opacity\\n\\n### \u267b Code Refactoring\\n\\n- **router:** remove all lazy loaded components\\n- **log:** expand log to level 1 by default\\n- **log:** extract pagination logic into hooks\\n- **log:** improve error messages for JSON logs\\n- **log:** re-arrange log levels via weight parameter\\n\\n### \u2705 Tests\\n\\n- **ui:** update snapshot tests for new css vars"},{"id":"release-v0.1.8","metadata":{"permalink":"/bublik-release/release-v0.1.8","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2023-08-09-release-v0.1.8/index.mdx","source":"@site/blog/2023-08-09-release-v0.1.8/index.mdx","title":"Release v0.1.8","description":"We are happy to announce Bublik v0.1.8.","date":"2023-08-09T00:00:00.000Z","formattedDate":"August 9, 2023","tags":[{"label":"release","permalink":"/bublik-release/tags/release"}],"readingTime":1.51,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/ol-limonikas","imageURL":"https://github.com/ol-limonikas.png","key":"ol-limonikas"}],"frontMatter":{"title":"Release v0.1.8","authors":["ol-limonikas"],"tags":["release"],"slug":"release-v0.1.8"},"prevItem":{"title":"Release v0.1.10","permalink":"/bublik-release/release-v0.1.10"},"nextItem":{"title":"Release v0.1.5","permalink":"/bublik-release/release-v0.1.5"}},"content":"We are happy to announce **Bublik v0.1.8**.\\nIn this release we focused mainly on improving charts usability.\\n\\n\x3c!--truncate--\x3e\\n\\n# Highlights\\n\\n### Ability to open charts in fullscreen mode\\n\\nYou can now open most of the charts in fullscreen mode\\n\\n![Fullscreen chart button](./img/fullscreen-chart-1.png)\\n\\n![Fullscreen chart](./img/fullscreen-chart-2.png)\\n\\n### Ability to compose multiple charts onto one plot\\n\\n:::info\\nWe are considering moving this view to separate page to allow URL sharing\\n:::\\n\\n![Fullscreen chart](./img/charts-combined-1.png)\\n\\n![Fullscreen chart](./img/charts-combined-2.png)\\n\\n### New runs badge input\\n\\nWe have added new badge input to runs page that should be working better then before.\\nWe are currently looking at changing history badge input and moving it to separate modal with input looking like on the runs page.\\n\\n![Badge input button](./img/badge-1.png)\\n\\n![Badge input](./img/badge-2.png)\\n\\n### Time delta\\n\\n:::caution\\nThis is not final design and UI improvements would be made regarding colors\\n:::\\n\\n![Delta](./img/delta-1.png)\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **log:** time delta not working correctly with timestamps\\n- **ui:** [tags-box-input] removing selected items\\n\\n#### \u267b Code Refactoring\\n\\n- **ui:** [chart] replace chart toolbar with updated\\n\\n#### \ud83d\udc85 Polish\\n\\n- **history:** [plot-list] add shadow to header when sticky\\n- **history:** [refresh] fix animation origin\\n- **measurements:** improve measurements chart layout\\n- **ui:** [button] don\'t allow click when loading\\n- **ui:** [chart] add more space in fullscreen mode\\n- **ui:** [export-button] fix icon and styles\\n- **ui:** [link] missing animation when loading\\n\\n#### \ud83d\udce6 Chores\\n\\n- **log:** add timestamp mock\\n- **measurements:** [chart] remove plot with series\\n- **ui:** [chart] adjust icon sizes\\n- **ui:** [chart] improve voice over labels\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **history, measuremensts:** add fullscreen chart\\n- **history:** [chart] add ability to view charts with multiple Y axises\\n- **ui:** [toolbar] add toolbar component\\n- **log:** add timestamp delta with anchor\\n\\n#### \u2705 Tests\\n\\n- **history, import:** update snapshot tests"},{"id":"release-v0.1.5","metadata":{"permalink":"/bublik-release/release-v0.1.5","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2023-05-31-release-v0.1.5/index.mdx","source":"@site/blog/2023-05-31-release-v0.1.5/index.mdx","title":"Release v0.1.5","description":"We are happy to announce Bublik v0.1.5","date":"2023-05-31T00:00:00.000Z","formattedDate":"May 31, 2023","tags":[{"label":"release","permalink":"/bublik-release/tags/release"}],"readingTime":3.655,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/ol-limonikas","imageURL":"https://github.com/ol-limonikas.png","key":"ol-limonikas"}],"frontMatter":{"title":"Release v0.1.5","authors":["ol-limonikas"],"tags":["release"],"slug":"release-v0.1.5"},"prevItem":{"title":"Release v0.1.8","permalink":"/bublik-release/release-v0.1.8"},"nextItem":{"title":"Release v0.1.3","permalink":"/bublik-release/release-v0.1.3"}},"content":"We are happy to announce **Bublik v0.1.5**\\nIn this release we added initial support for new log UI. Added ability to open/collapse sidebar menus.\\nMany more style and internal changes\\n\\n\x3c!--truncate--\x3e\\n\\n# Highlights\\n\\n### Reworked sidebar\\n\\nWe\'ve added ability to show/hide collapsed menus inside sidebar at any time. Now you can jump back and forth between different pages\\n\\n:::tip\\nAlso you can now hide/show sidebar by pressing **`S`** on the keyboard\\n:::\\n\\n![Reworked sidebar](./img/Capture-2023-06-09-103917.png)\\n\\n### New changelog UI\\n\\nWe also added changelog\\n\\n![New changelog](./img/Capture-2023-06-09-104647.png)\\n\\n### Reworked run toolbar\\n\\nWe\'ve moved toolbar with various buttons\\n\\n![Reworked toolbar](./img/Capture-2023-06-09-104900.png)\\n\\nAdded ability to hide/show columns via dropdown menu\\n\\n![Toggle run table columns](./img/Capture-2023-06-09-105115.png)\\n\\n### Opening NOK results on link click\\n\\nYou can now go to run with opened results by clicking on NOK with `Ctrl+click`\\n\\n![Nok results](./img/Capture-2023-06-09-105620.png)\\n\\n### New log UI\\n\\n:::caution\\nThis is experimental feature and may not work as expected!\\n:::\\n\\nIn this release we started to integrate new log UI this is still work in progress.\\nWe want to hear your feedback and features you maybe want :)\\n\\n![New log UI](./img/Capture-2023-06-09-110507.png)\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\udcdd Documentation\\n\\n- **config:** adjust docs to new build pipeline\\n\\n#### \ud83d\udc77\u200d Build System\\n\\n- **size:** extract echarts chunk manulally to reduce size\\n- **vite:** add ability to specify remote JSON logs storage\\n\\n#### \ud83d\udd27 Continuous Integration | CI\\n\\n- **build:** fix failing to parse passed args\\n- **build:** skip changelog for beta releases\\n\\n#### \u267b Code Refactoring\\n\\n- **icon:** convert all icons to `.svg`\\n- **run:** change displayed run columns\\n- **ui:** replace all skeletons with component\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **history:** lazy loading modules\\n- **log:** [frame] not saving line number on subsequent navigations\\n- **runs:** date range picker no label warning\\n- **runs:** importing from lazy loaded module\\n\\n#### \ud83d\udc85 Polish\\n\\n- **animation:** [dialog] add animation to dialog content\\n- **changelog:** add confetti explosion on new release\\n- **history:** add animation to context menu\\n- **history:** align reset buttons with close button\\n- **import:** fix overflow scrollbars\\n- **import:** make modal title bigger\\n- **run:** [table] add group columns with border\\n- **run:** add background on row hover\\n- **run:** uppercase table columns\\n- **tooltip:** change shadow\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **ci:** add changelog to the ui\\n- **faq:** add latest tag info\\n- **formatting:** convert formatting to use tabs\\n- **log:** add experimental support for JSON logs\\n- **log:** add initial support for displaying log content\\n- **log:** add pagination support to schema\\n- **log:** add pagination support to schema\\n- **run:** [results-table] add key list with URLs\\n- **run:** add column visibility toggle to run/diff pages\\n- **run:** add tooltips to details/toolbar buttons\\n- **sidebar:** add collapsible links\\n- **sidebar:** show/hide sidebar on `s` keypress\\n- **ui:** add dropdown menu component\\n- **ui:** add skeleton component\\n\\n#### \u23ea Reverts\\n\\n- **log:** [frame] not saving line number on navigations\\n- **run:** rollback renaming column ids for run table\\n\\n#### \u2705 Tests\\n\\n- **ci:** fix lint command\\n- **e2e:** add playwright support\\n- **history:** add some snapshot tests to history\\n- **import:** fix snapshot for overflow table\\n- **import:** fix snapshot test for loading table state\\n- **log:** remove build target from lib\\n- **run:** fix div instead of button when no URL present\\n- **ui:** [clock] fix timezone issue in CI\\n- **ui:** [icon] fix svgr not loading in vitest\\n\\n#### \ud83d\udce6 Chores\\n\\n- **build:** migrate from webpack to vite\\n- **build:** upgrade vite to v4.3\\n- **changelog:** [modal] disable modal until checkbox is ready\\n- **changelog:** lazy load changelog\\n- **ci:** add new commit types\\n- **ci:** fix compare URL\\n- **ci:** update pipeline for manual releases\\n- **deploy:** adjust API for new JSON format\\n- **env:** move all env configs to bublik app config\\n- **log:** add run ID to tab title\\n- **log:** remove zod schema converting to JSON from production bundle\\n- **nx:** upgrade nx to 16.2.1\\n- **release:** v0.16.0\\n- **test:** update snapshots\\n\\n### Backend\\n\\n#### \ud83d\udc85 Polish\\n\\n- update run stats structure\\n- reduce the number of requests when fetching the result details\\n- reduce the number of queries to the DB for retrieving metas and test arguments\\n- recalculate stats for the previously imported runs\\n- avoid measurement results dups after live import\\n\\n#### \ud83d\ude80 New Feature\\n\\n- implement the new API to get JSON log URL\\n- add runtime to the import table"},{"id":"release-v0.1.3","metadata":{"permalink":"/bublik-release/release-v0.1.3","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2023-03-17-release-v0.1.3/index.mdx","source":"@site/blog/2023-03-17-release-v0.1.3/index.mdx","title":"Release v0.1.3","description":"We are happy to announce Bublik v0.1.3","date":"2023-03-17T00:00:00.000Z","formattedDate":"March 17, 2023","tags":[{"label":"release","permalink":"/bublik-release/tags/release"}],"readingTime":1.26,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/ol-limonikas","imageURL":"https://github.com/ol-limonikas.png","key":"ol-limonikas"}],"frontMatter":{"title":"Release v0.1.3","authors":["ol-limonikas"],"tags":["release"],"slug":"release-v0.1.3"},"prevItem":{"title":"Release v0.1.5","permalink":"/bublik-release/release-v0.1.5"},"nextItem":{"title":"Release v0.1.2","permalink":"/bublik-release/release-v0.1.2"}},"content":"We are happy to announce **Bublik v0.1.3**\\n\\nAdded features, bugs and more!\\n\\n\x3c!--truncate--\x3e\\n\\n# Highlights\\n\\n### New icon for skipped tests\\n\\n![Log page tree skipped tests](./img/SCR-20230318-chrl.png)\\n\\n### Added more data to import event table\\n\\n![Import page table](./img/SCR-20230318-cjpi.png)\\n\\n### New form for importing multiple runs at once\\n\\n![Import multiple runs at once](./img/SCR-20230317-hkff.png)\\n\\n![Import list results](./img/SCR-20230317-hlar.png)\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- feat(dashboard): expand NOK result on link click for `unexpected`\\n- feat(import): add form for importing multiple runs at once\\n- feat(import): add filter by task id, error message, log URL to form\\n- feat(log): mark skipped tests with icon\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- fix(import): fix sidebar not sticking when table overflows page\\n\\n#### \ud83d\udc85 Polish\\n\\n- style(import): fix header dissapearing on when error present\\n- style(import): overflowing table should be scrollable\\n- chore(history): format dates in header legend\\n\\n---\\n\\n### Backend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- change the error message structure\\n- add \'skipped\' info to the iteration data forwarded to the UI\\n- add new endpoint /v2/importruns/source to make imports from import status table\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- runs import without logs\\n\\n#### \u270f\ufe0f Other\\n\\n- add facility, severity, timestamp and Error message to the import statuses table\\n- add filtration by Celery task ID, Error message, Log URI to the import statuses table\\n- change the format of storing the expected result keys\\n- move key parsing from the import stage to the statistics generation stage\\n- add support for \\"ref://type/tail\\" keys to key parsing"},{"id":"release-v0.1.2","metadata":{"permalink":"/bublik-release/release-v0.1.2","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2023-02-20-release-v0.1.2/index.mdx","source":"@site/blog/2023-02-20-release-v0.1.2/index.mdx","title":"Release v0.1.2","description":"We are happy to announce Bublik v0.1.2","date":"2023-02-20T00:00:00.000Z","formattedDate":"February 20, 2023","tags":[{"label":"release","permalink":"/bublik-release/tags/release"}],"readingTime":1.73,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/ol-limonikas","imageURL":"https://github.com/ol-limonikas.png","key":"ol-limonikas"}],"frontMatter":{"title":"Release v0.1.2","authors":["ol-limonikas"],"tags":["release"],"slug":"release-v0.1.2"},"prevItem":{"title":"Release v0.1.3","permalink":"/bublik-release/release-v0.1.3"},"nextItem":{"title":"Release v0.1.1","permalink":"/bublik-release/release-v0.1.1"}},"content":"We are happy to announce **Bublik v0.1.2**\\n\\nIn this release we focused on more robust error experience, so you can have more context on what exactly went wrong.\\nAlso, we added more self-describing tab names, so you can easily find what you are looking for.\\n\\n\x3c!--truncate--\x3e\\n\\n# Highlights\\n\\n## Error details\\n\\n### Example error\\n\\n![Error details](./img/history-error.png)\\n\\n## History context menu\\n\\n:::info\\nSelecting tags will apply filters and refetch the data. <br/>\\nIt works just like clicking refresh button\\n\\n:::\\n\\n![History context menu](./img/history-context-menu.png)\\n\\n## Tab names\\n\\n### Example tab names\\n\\n![Tab names](./img/tabs.png)\\n\\n## Details diff\\n\\n### Example diff\\n\\n![Details diff](./img/details-diff.png)\\n\\n## Event logs\\n\\n### Example event logs table\\n\\n![Events logs table](./img/event-log.png)\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- feat(history): add reset button to history global filter form\\n- feat(history): add context menu to history linear/aggregation tables\\n- feat(help): bake frontend revisions into deploy-info component at build time\\n- feat(dev): add events table with celery task status and links to logs/flower\\n- feat(run-diff): [details] add diff for run info details\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- fix(history): remove unnecessary requests if no test name is found\\n- fix(history): failing to parse URL search params on some requests\\n- fix(runs): add total percentage of expected runs\\n- fix(run-diff): don\'t show suspence loading spinner for run-diff page\\n- fix(dev): flower URL is incorrect in iframe\\n- fix(ui): [datepickers] wrong order of date segments and wrong literals\\n\\n#### \ud83d\udc85 Polish\\n\\n- style(history): add backdrop blur for dialogs\\n- style(history): place duration in column to save some space\\n- style(run): add empty state for run page\\n- chore(sidebar): move flower/import/tests links under dev menu\\n\\n---\\n\\n### Backend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- the table of import statuses is added to the dev section\\n\\n#### \ud83d\udcbe DB changes\\n\\n- added a new model - EventLog to log Bublik events\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- parse and show plan info\\n\\n#### \u270f\ufe0f Other\\n\\n- persistent option added to the Flower service to save Celery tasks after services restart\\n- changes applied to gunicorn and nginx to change max buffer and size of URIs"},{"id":"release-v0.1.1","metadata":{"permalink":"/bublik-release/release-v0.1.1","editUrl":"https://github.com/ts-factory/bublik-release/edit/main/blog/2023-01-20-release-v0.1.1/index.mdx","source":"@site/blog/2023-01-20-release-v0.1.1/index.mdx","title":"Release v0.1.1","description":"We are happy to announce Bublik v0.1.1","date":"2023-01-20T00:00:00.000Z","formattedDate":"January 20, 2023","tags":[{"label":"release","permalink":"/bublik-release/tags/release"}],"readingTime":3.515,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/ol-limonikas","imageURL":"https://github.com/ol-limonikas.png","key":"ol-limonikas"}],"frontMatter":{"title":"Release v0.1.1","authors":["ol-limonikas"],"tags":["release"],"slug":"release-v0.1.1"},"prevItem":{"title":"Release v0.1.2","permalink":"/bublik-release/release-v0.1.2"}},"content":"We are happy to announce **Bublik v0.1.1**\\n\\nWe\'ve added experimental support for comparing two runs, new datepicker component with better accessibility and keyboard navigation, new page mode for history where you can see values change over time and more.\\n\\n\x3c!--truncate--\x3e\\n\\n# Highlights\\n\\n## Run Diff\\n\\n:::caution\\n\\nThis feature is experimental and may not work as expected\\n\\n:::``\\n\\n### Diff view\\n\\nIn this release we\'ve added experimental support for comparing two runs\\n\\n![Run diff page](./img/run-diff-page.png)\\n\\n### Access diff from runs page\\n\\nYou can now click on two run rows on runs page and select `Compare` button to compare them\\n\\n![Runs selection](./img/runs-to-diff.png)\\n\\n### Access diff from run page\\n\\nYou can access this page via `Run` -> `Compare` button\\n\\n![Compare button](./img/compare-button.png)\\n\\n---\\n\\n## History\\n\\n### Filter Reset\\n\\nYou can now reset client side filters in history page\\n\\n:::info\\n\\nSometimes client side filters _(click search)_ may not work as expected. In this case you can reset them by clicking on `Reset filters` button\\n\\n:::\\n\\n![History reset filters](./img/history-reset-filters.png)\\n\\n### Measurements\\n\\nWe\'ve also added a new page mode for history where you can see values change over time\\n\\n![History charts](./img/history-charts.png)\\n\\n#### Measurement Info\\n\\nYou can click on chart point to bring up modal with additional information as well as ability to jump directly to log/measurements/run\\n\\n![History charts modal](./img/history-chart-modal.png)\\n\\n---\\n\\n## New Date pickers\\n\\nWe\'ve added new datepicker component with better accessibility and keyboard navigation\\n\\n### Datepicker\\n\\n![Datepicker](./img/datepicker.png)\\n\\n### Date-range picker\\n\\n![Date range picker](./img/date-range-picker.png)\\n\\n---\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- feat: add new datepicker component with better accessibility\\n- feat: add new datepicker range component with better accessibility\\n- feat(run): add URL state handling for run table\\n- feat(run): add ability to compare runs via form in run\\n- feat(run): add skeleton loading for run details state\\n- feat(run-diff): add initial run-diff page\\n- feat(measurements): add suspended ui and skeleton for history measurements\\n- feat(log): add skeleton loading to log tree\\n- feat(help): add better error message when couldn\'t fetch revisions\\n- feat(history): add reset client side filters button to history\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- fix(run): `crtl + click` not applying filters to subtree\\n- fix(run-diff): change the way arrow direction is decided for run-diff\\n- fix(run-diff): improve package matching\\n- fix(help): tooltip with revision info not working\\n- fix(measurements): gap in value table column\\n- fix: enable horizontal scroll for badge input by default\\n- fix(measurements): export crashing on empty values\\n- refactor(runs): rewrite runs page with better architecture\\n- refactor(history): rewrite history page with better architecture\\n\\n#### \ud83d\udc85 Polish\\n\\n- fix(history): don\'t reset date range field in history global search\\n- feat(history): add history skeleton on no results found\\n- chore(history): add border around table rows\\n- feat(runs): add skeleton when no results found\\n- chore(runs): add border around table rows\\n- fix: badge rendering as button when no `onClick` handler passed\\n\\n---\\n\\n### Backend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- meta_categorization: change the approach of categorizing metas\\n- commands: add command to add tags extracted from the log\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- measurements: change the json forwarded to the UI\\n- measurements: increase the speed of processing by using faster sorting and filtering methods for DB objects\\n- measurements: create proper objects in DB when handling measurements\\n- charts: add axises_config and axises titles to the json forwarded to the UI\\n- charts: combine chart that differ only in comments\\n- history: increase the speed by using proper filtration of test results, test runs, results and test\\n- importruns: change an option forwarded to rgt-log-bundle-get-original from TE since it has changed in TE itself\\n- importruns: change the handling of measurements import errors\\n- hash: the default hashing algorithm was changed to avoid creating duplicates in DB\\n- metas: add check for STATUS meta in `meta_data.json`\\n- metas: update metas even if the run is not completed\\n- cache: update cache after new meta categorization process\\n- celery: add option to specify number of task after completing which the worker will be reloaded\\n- run_diff: add execution sequence to the data provided to UI to show run_diff\\n- result_summary: return only summary values not the whole results\\n\\n  #### Other changes\\n\\n- coding_style: apply **black**, **flynt**, **unify** and **isort** to the whole project"}]}')}}]);